import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class WelcomePage extends Component {
    render() {
        return (

            <div styles={{ width: '100%', margin: 'auto' }}>
                <Grid className="welcomepage-grid">
                    <Cell col={12}>
                        <img
                            src=""
                        />

                    </Cell>
                </Grid>
            </div>

        );

    }
}

export default WelcomePage;
